    "prototype-technology-evaluator-and-research-aircraft-ptera-flight-test-assessment-project",nt"isopen":
    true,nt"url": null,nt"notes": "The Area-I team has developed and fabricated
    the unmanned Prototype-Technology Evaluation and Research Aircraft or PTERA ("ptera"
    being Greek for wing, or wing-like). The PTERA is an extremely versatile and high-quality,
    yet inexpensive flight research testbed that serves as a bridge between wind tunnel
    and manned flight testing by enabling the low-cost, low-risk flight-based evaluation
    of a wide array of high-risk technologies.",nt"license_title": "U.S. Government
